import React from 'react';
import { Card, CardContent, CardMedia, Typography, Grid,Button } from '@mui/material';
import image2 from './image3.jpg'

const PatientCard = ({ name, dob, disease, value, image }) => {
  return (
    
    <Card sx={{ maxWidth: 545}}  className=" card shadow-lg"  style={{height:"500px",width:"700px",marginLeft:"480px",background:"pink",paddingTop:"20px",marginTop:"100px",paddingLeft:"20px",border:"2px solid"}}>
      <Grid container>
        <Grid item xs={4}>
          <CardMedia
            component="img"
            height="200"
            image={image2}
            alt={name}
            border="2px black solid"
            
          />
        </Grid>
        <Grid item xs={8}>
            
          <CardContent style={{marginLeft:"70px"}}>
            <Typography gutterBottom variant="h3" component="div">
              {name}
            </Typography>
            <Typography variant="h6" style={{marginTop:"20px"}} color="text.secondary">
              Date of Birth: {dob}
            </Typography>
            <Typography variant="h6" style={{marginTop:"20px"}} color="text.secondary">
              Disease: {disease}
            </Typography>
            <Typography variant="h6" style={{marginTop:"20px"}} color="text.secondary">
              Gender: {value}
            </Typography>
            <Button style={{color:"white",background:"#FF6F61",marginTop:"200px",marginLeft:"100px"}} variant='contained'>Prescripition</Button>
            
          </CardContent>
        </Grid>
        
      </Grid>
    </Card>
    
  );
};

const LandingPage = () => {
  return (
    <div style={{ backgroundColor: "#e6f4ff", minHeight: "100vh" }}>
        <h1 style={{marginLeft:"650px",paddingTop:"50px",fontFamily:"'Roboto', sans-serif"}}>Patient Details</h1>
        <hr></hr>
      <Grid container spacing={2}>
        <Grid item xs={12} sm={6} md={4}>
          <PatientCard
            name="John Doe"
            dob="01/01/1990"
            disease="Flu"
            value="Male"
            image="https://via.placeholder.com/150"
          />
          
        </Grid>
       
        {/* Add more PatientCard components as needed */}
      </Grid>
     
      
    </div>
  );
};

export default LandingPage;
